// types
import { ButtonsWithLabel } from './types';

export const buttonsWithLabels: ButtonsWithLabel[] = [
    {
        variant: 'success',
        icon: 'mdi mdi-check-all',
    },
    {
        variant: 'danger',
        icon: 'mdi mdi-close-circle-outline',
    },
    {
        variant: 'info',
        icon: 'mdi mdi-alert-circle-outline',
    },
    {
        variant: 'warning',
        icon: 'mdi mdi-alert',
    },
];
